import * as React from 'react'

const SvgMicrophoneIcon = (props) => (
  <svg
    width={40}
    height={40}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    {...props}
  >
    <circle cx={20} cy={20} r={20} fill="#2F80ED" />
  </svg>
)

export default SvgMicrophoneIcon
